script:
// hide all decals when loading:
$("#Insignia image").css("display", "none");

// change background to grey
$("body").css("background-color", "#252525");

// button controls:
$(document).on("click", "#InsigniaCtrl Image", function(){

	// get the name of the clicked button (e.g. button named "SW" for "Space Wolves") :
	var chapter = $(this).attr("id");

	// hide any previously displayed decals:
	$("#Insignia image").css("display", "none");

	// show decal that matches the clicked button (button named "SW" activates decals named "SW_decals"):
	$("#" + chapter + "_decals").css("display","block");
});
